import Header from "../components/Headers/Header.jsx";
import Footer from "../components/Sidebars/Footer.jsx";
import Feed from "../components/Body/Feed.jsx";
import Leftbar from "../components/Sidebars/Leftbar.jsx";
import Rightbar from "../components/Sidebars/Rightbar.jsx";
import {Routes, Route} from 'react-router-dom';
import PostForm from "../components/Body/PostForm.jsx";
import PostEdit from "../components/Body/PostEdit.jsx";
import Portfolios from "../components/Body/Portfolios.jsx";
import {useState} from 'react'; 



function Home({showProfile}) {

    const [diaryId, setDiaryId]= useState(null);
    const [navBars, setNavbars] = useState (true);
    //Usestate for displaying sidebars for links they arent required.

    return (
        <div className="bg-gray-200 h-full min-h-screen pb-40">
           {navBars &&
                <>
                <Header/> 
                <Leftbar/>  
                </> 
            }
                    <Routes>
                        <Route exact path ="/" element ={<Feed diaryId={diaryId} setDiaryId = {setDiaryId} setNavbars= {setNavbars}/>}/>
                        <Route exact path ="/PostForm" element ={<PostForm />}/>
                        <Route exact path ="/PostEdit" element ={<PostEdit diaryId={diaryId} setDiaryId = {setDiaryId} setNavbars= {setNavbars}/>}/>
                        <Route exact path ="/Portfolios" element = {<Portfolios diaryId={diaryId} setDiaryId = {setDiaryId} setNavbars= {setNavbars}/>}/>

                    </Routes> 
             {navBars &&  
                <>
                <Rightbar/>             
                <Footer/>
                </>
             }



        </div>
    )
}

export default Home;
